const[type, setType] = useState('');
if(props.type==='welcome'){
  setType('main_nav')
}
else{
  setType('other_nav')
}
  return (
    <div>
      <nav classname={type}>
       <ul className='nav_link'>
         <Link to='/resume' className='link'><li>cloud resume</li></Link>
         <Link className='link'><li>posts</li></Link>
         <Link className='link'><li> fun stuff</li></Link>
         <Link className='link'><li >contact me</li></Link>
       </ul>
      </nav>
    </div>
  )
}

export default Nav
